e.addCamera = new ButtonDrawer();	Interface.addCamera.setImage(Interface.fileDir + "icons/camera/camera.png");	Interface.addCamera.optionsPerLine = 2;	Interface.addCamera.imageScale.set(0.7, 0.7);	Interface.addCamera.optionsScale.set(0.7, 0.7);	Interface.addCamera.size.set(Interface.toolBar.size.x, Interface.toolBar.size.x);	Interface.addCamera.position.set(0, 360);	Interface.addCamera.optionsSize.set(40, 40);	Interface.addCamera.updateInterface();	//Prespective camera	Interface.addCamera.addOption(Interface.fileDir + "icons/camera/prespective.png", function()	{		Editor.addToScene(new PerspectiveCamera(60, Editor.canvas.width/Editor.canvas.height));	}, "Prespective Camera");	//Orthographic camera	Interface.addCamera.addOption(Interface.fileDir + "icons/camera/orthographic.png", function()	{		Editor.addToScene(new OrthographicCamera(3, 2, OrthographicCamera.RESIZE_HORIZONTAL));	}, "Othographic Camera");	//Add script	Interface.addScript = new ButtonDrawer();	Interface.addScript.setImage(Interface.fileDir + "icons/script/script.png");	Interface.addScript.optionsPerLine = 1;	Interface.addScript.imageScale.set(0.7, 0.7);	Interface.addScript.optionsScale.set(0.7, 0.7);	Interface.addScript.size.set(Interface.toolBar.size.x, Interface.toolBar.size.x);	Interface.addScript.position.set(0, 400);	Interface.addScript.optionsSize.set(40, 40);	Interface.addScript.updateInterface();	//Javascript script	Interface.addScript.addOption(Interface.fileDir + "icons/script/script.png", function()	{		Editor.addToScene(new Script());	}, "JS Script");	//Sprites and effects	Interface.addEffects = new ButtonDrawer();	Interface.addEffects.setImage(Interface.fileDir + "icons/effects/particles.png");	Interface.addEffects.optionsPerLine = 3;	Interface.addEffects.imageScale.set(0.7, 0.7);	Interface.addEffects.optionsScale.set(0.7, 0.7);	Interface.addEffects.size.set(Interface.toolBar.size.x, Interface.toolBar.size.x);	Interface.addEffects.position.set(0, 440)